import Card from './../../components/Card'
import icon from './../../assets/icon.png'
import { Container, Img, InputText, Bt, Label } from './index.syles';


export default function Component() {
  const [date, setdate] = useState([]);

  function validation(e) {
    e.preventDefault();
    console.log(setdate)
    try {
      var cpf = document.getElementById('cpf').value;
      setdate([cpf]);
    } catch (error) {
      console.log(error);
    }
    console.log(date[0])

  }
  return (
    <Container>
      <Card title="Login" >
        <Img src={icon} />
        <Label>CPF</Label>
        <InputText type="text" id="cpf" placeholder="CPF cadastrado" />
        <Label>Senha</Label>
        <InputText type="password" id="senha" placeholder="senha" />
        <Bt type="submit" onClick={validation}> Enviar</Bt>

      </Card >

    </Container>
  );
}
